import { useState } from 'react';
import './App.css';
import { fetchHelloWorld } from './services/HelloWorldService';

function App() {
    const [currentTime, setCurretTime] = useState(0);
    const [label, setLabel] = useState(""); //pide un espacio en memoria
    const clickHandler = async () => {
    const result = await fetchHelloWorld();
    setLabel(result);
};

setInterval(() =>{
    setCurretTime(currentTime, 1);
}, 1000);

return (
<div className="App">
<button onClick={() => clickHandler()}>Call API</button>
{label}
</div>
);
}

export default App;
